import classes from "./MealsSummary.module.css"
import React from "react"
const MealsSummary = ()=>{
    return(
      <React.Fragment>
        <div className={classes.summary}>
          <h2>summary</h2>
        </div>
      </React.Fragment>
    )
}


export default MealsSummary
